import React from "react";
import "../default-container/default-container.css";
import { DefaultHeader } from "../../components/default-header";

export default function DefaultContainer() {

  function footerLogo_Click() {
    window.open('https://sphera.com/', 'mywindow');
  }

  return (
    <div>
      <div id="divHeader" runat="server" class="defaultheader">
        <DefaultHeader />
        <div class="otherSection">
        </div>
      </div>

      <div id="navbarPlaceholder">
      </div>


      <nav id="navigation" class="navbar navbar-inverse menu-background sht-navbar">
      </nav>


      <div class="footerPlaceholder">
      </div>
      
      <div class="footer footerFixed">
            <span className="version">v1.0.0</span>
            <span className="copyright" id="copyrightYear">Â© 1993 - 2020 Sphera Solutions, Inc. All Rights Reserved.</span>
            <a target="_blank" href={require("../../_public/PrivacyStatement.htm")} className="footerLnk privacyStatement">Privacy Statement</a>
            <div className="footerLogo" onClick={footerLogo_Click}>
                <img className="footerLogoImg" src={require("../../images/SpheraCommunicatorFooter.png")} />
            </div>
      </div>

    </div>
  );
}
